import React from "react";

const CryptoTrend = () => {
  return (
    <section
      id="trends"
      className="w-full min-h-screen pt-24 px-4 flex flex-col items-center justify-center text-center bg-gradient-to-b from-gray-900 via-black to-gray-950"
    >
      <h2 className="text-4xl font-bold mb-4 text-white">Crypto Trends</h2>
      <p className="text-gray-400 max-w-2xl">
        Analyze real-time market patterns with AI-enhanced prediction algorithms.
      </p>
    </section>
  );
};

export default CryptoTrend;
